  "text" : "[円周率πが割り切れない理由] 直径1の円の円周はπです（円周率の定義より）。もしπが10進法で有限小数なら、自然数p,qを使ってπ=p×10^{-q}と表せます。これは、1辺の長さが10^{-q}の正p角形の周の長さとπが同じだということですが #まで考えた",
